import React from "react";
function Tasks(){
    return(
        <div className="profile">
            <h1>Актуальные задачи</h1>
            <ul>
                <li><font color="white"><h2>Помыть полы</h2></font></li>
            </ul>
        </div>
    )
}
export default Tasks;
